# README.md
# Claude API

A TypeScript/JavaScript SDK for the Anthropic Claude API.

[![npm version](https://img.shields.io/npm/v/claude-api.svg)](https://www.npmjs.com/package/claude-api)
[![License: MIT](https://img.shields.io/badge/License-MIT-yellow.svg)](https://opensource.org/licenses/MIT)

## Features

- Complete TypeScript support with accurate types for all API endpoints
- Support for both the Messages API and Completions API
- Streaming support for real-time responses
- Tool use (function calling) support
- Image input support
- Full compatibility with Claude 3 models (Opus, Sonnet, Haiku)
- Comprehensive error handling
- Works in Node.js and modern browsers
- Zero dependencies

## Installation

```bash
npm install claude-api
```

## Usage

### Initializing the Client

```typescript
import { Claude } from "claude-api";

const claude = new Claude({
  apiKey: "your-api-key", // Get from https://console.anthropic.com/
});
```

### Messages API

The Messages API is the recommended way to interact with Claude. It supports multi-turn conversations, images, and tool use.

#### Basic Text Completion

```typescript
const response = await claude.messages.create({
  model: "claude-3-opus-20240229",
  max_tokens: 1000,
  messages: [
    {
      role: "user",
      content: "Write a short poem about artificial intelligence.",
    },
  ],
});

console.log(response.content[0].text);
```

